import React, { Component } from 'react'

export class Thumbnail extends Component {
    render() {
        return (
            <div>
                <div className="row">
                    <div className="col-md-5">
                        <div className="thumbnail">
                            <a href="#">
                                <img src="/img/H.png" alt="Lights" style={{width:"100%"}}/>
                                <div className="caption caption-rignt">
                                    <p>Lorem ipsum...</p>
                                </div>
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Thumbnail;
